import logo from './syncreon logo.png';
import './App.css';
import React from "react";
import {Button} from 'react-bootstrap'
function Home () {
    return(
    <div className="App">
      <header className="App-header">
        <img src={logo}  />
        <p>
          Welcome to Syncreon Project.
        </p>
      </header>
      <Button >View Orders</Button>
    </div>
    );
}

export default Home;
